import React from "react";

const SocialLinks = () => {
  return (
    <div>
      <h3>Contact With Me</h3>
      <ul>
        <li>Facebook</li>
        <li>Twitter</li>
        <li>LinkedIn</li>
      </ul>
    </div>
  );
};

export default SocialLinks;
